import React from 'react';

const About = () => (
  <section id="about" className="py-8 bg-white scroll-mt-20">
    <div className="container mx-auto px-4">
      <h2 className="text-3xl font-bold text-center mb-8 text-blue-600">Công Ty TNHH MTV Bao Bì Đình Duy</h2>
      <p className="text-gray-700 text-center max-w-3xl mx-auto">Chúng tôi là nhà sản xuất bao bì hàng đầu tại Việt Nam, chuyên cung cấp các giải pháp bao bì đa dạng từ hộp carton, túi giấy, bao bì sinh học đến bao bì công nghiệp. Với hơn 20 năm kinh nghiệm, chúng tôi cam kết sử dụng vật liệu thân thiện môi trường và công nghệ hiện đại.</p>
    </div>
  </section>
);

export default About;
